import React, { useState, useEffect } from 'react';

function AllTodos() {
  const [tasks, setTasks] = useState([]);

  useEffect(() => {
    fetch('tasks.json')
      .then(response => response.json())
      .then(data => setTasks(data))
  }, []);

  return (
    <div>
      <h2>All Todos</h2>
      <ul>
        {tasks.map(task => (
          <li key={task.id}>{task.title}</li>
        ))}
      </ul>
    </div>
  );
}

export default AllTodos;
